import React, { useEffect, useState } from 'react'; 
import axios from 'axios';
function Fetchtable(){
    const [rec,setRec]=useState([]);
    useEffect(()=>{
        axios.get('localhost:5050/api/call/userinfo/')
        .then(res=>setRec(res.data))
        .catch(err=>console.log(err));

    },[])
    return(
<table>
    <thead>
        <tr>
            <th>Email</th>
            <th>FirstName</th>
            <th>LastName</th>
            <th>Mobile</th>
            <th>DOB</th>
        </tr>
    </thead>
    <tbody>
        {
            rec.map((user,index)=>{
                <tr key={index}>
                    <td>user.email</td>
                    <td>user.firstname</td>
                    <td>user.lastname</td>
                </tr>
            })
        }
    </tbody>
</table>
    )
}
export default Fetchtable;
